@FratellidItalia è sempre stato a favore della campagna vaccinale. Quello che contestiamo è la mancanza di coraggio del #Governo di chiedere al #Parlamento di discutere un DDL su obbligo vaccinale. Con il #GreenPass il Governo non si prende responsabilità.
-Staff https://t.co/NTTzuTXsy1

L'obbligo vaccinale è già di per sé una follia.

Se poi il Governo lo impone anche ai minori, ha toccato il fondo della decenza.

@FratellidItalia si opporrà sempre alle decisioni scellerate di una maggioranza incapace di tutelare i più deboli! https://t.co/1hhCqTLNdB

